import React, {Component} from "react";
import Clock from './components/clock/Clock';


class Card extends Component {
    constructor(props) {
        super(props);
        this.cardTitle = props.title;
        this.cardText = props.text;
    }

    render() {
        return (
            <div className={"card"}>
                <div className={"card-body"}>
                    <h1>{this.cardTitle}</h1>
                    <p>{this.cardText}</p>
                </div>
            </div>
        );
    }
}

export default Card;
